import React, { Component } from "react";
import "./Footer.css";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebookMessenger,
  faFacebookF,
  faInstagram
} from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { Link, IconButton } from "@material-ui/core";

class Footer extends Component {
  render() {
    return (
      <div className="footer-container">
        <div>
          <span
            style={{
              color: "black",
              fontSize: 17,
              fontWeight: "bold"
            }}
          >
            Find us on:
          </span>
          <br />
          <IconButton>
            <Link href="https://www.facebook.com/rogervnn/">
              <FontAwesomeIcon
                icon={faFacebookF}
                style={{ width: 30, height: 30 }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="https://m.me/rogervnn?fbclid=IwAR0Ozfd8hPuSbteKHsg-V31eD52mjeL9QdVn8QjQTUo_t1j-JB0Ij-JCyMw">
              <FontAwesomeIcon
                icon={faFacebookMessenger}
                style={{ width: 30, height: 30 }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="https://l.facebook.com/l.php?u=http%3A%2F%2Froger.vn%2F%3Ffbclid%3DIwAR1tLXihEW9yReeOpy75zIT8tCY4aanqgvG9r1BQShz7f8Z2Jx09H_-es7M&h=AT2UJYxqi_39YoQ73mAJ2sKRj7Us-gAJUwkY-v-SCG3SVX6cvbSIfRIWQokGoiLyLKtiJI8jbkKvPRxxyncxMQI6L0qqKEThaRxnBlS0UaBktx8UD8w502U9Y_nEd5E6W8RepRaVyQCIxvdW2wiQb2lZsCUO-LkpebQGLvBJPbutg3zW7gG-n8JCxdnFAAEqp5UihzlxTE5N00-TmY_BQGE-Y1vg2yQIpUCPSHPVgUfkE3Z6IKBeNqGmTgmAfVYmibKFtw5wCIAfgfsm1_nXiFX9ZsBlhzIWQJif7UXMA8_MWonbQungGk42JL6vqCzAQfj2DoeXcL0vfEJjZjNflYSL1KyxrYhawLH4ZAw8_leKL9QNI4Nvi9YEF6KtSTwFEoEWPb7r7pNgOMo0WFOUX71m50_s4LqswizQGqwmwK1E1kUjVdb_EM3NyPQIeJhKoE1xVHYW1Tim9FtLXjFQXiL3Kj8_BisJdCiHWB16_Se77BOxhbHOi9mizt8a">
              <FontAwesomeIcon
                icon={faInstagram}
                style={{ width: 30, height: 30 }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="rogershoesvn@gmail.com">
              <FontAwesomeIcon
                icon={faEnvelope}
                style={{ width: 30, height: 30 }}
              />
            </Link>
          </IconButton>
        </div>
        <div>
          <span className="title-footer">
            © 2009–2019 Zappos LLC or its affiliates, 400 East Stewart Avenue.
            Las Vegas NV 89101
          </span>
          <br />
          <span className="title-footer">
            6pm.com is operated by Zappos IP LLC. Products on 6pm.com are sold
            by 6pm.com, LLC.
          </span>
          <br />
          <span className="title-footer">
            e-Gift Cards on 6pm.com are sold by ACI Gift Cards LLC.
          </span>
          <br />
          <span className="title-footer">
            For premier service, selection, and shipping, visit Zappos.com —
            your one-stop shop for the latest in Shoes, Sandals, Dresses, Jeans
            and more!
          </span>
          <br />
          <span className="title-footer">
            For luxury and designer styles, visit Zappos Luxury.
          </span>
          <br />
        </div>
      </div>
    );
  }
}

export default Footer;
